import React, { useEffect, useState } from 'react';
import '../App.css';
import PetCard from './Pet-card';

export default function LandingPage() {
  const [petData, setPetData] = useState([]);

  useEffect(() => {
    fetch('/api/pets')
      .then((response) => response.json())
      .then((data) => setPetData(data));
  }, []);

  return (
    <div>
      <h2>Mission Statement</h2>
      <p>Two struggling Web Developers trying to help dogs and cats find their Fur-ever Home!</p>
      <p>We are Tess and John, two Vanderbilt Coding Students who are working on honing our skills on an app that fulfills a need in our local communities for matching users with a dog or cat.</p>
      <div>
        {petData.map((pet) => (
          <PetCard key={pet.id} pet={pet} />
        ))}
      </div>
    </div>
  );
}
